import MemoryCard from "./MemoryCard"

const Game = ( {images} ) => {
    return (
        <div>
            <div className='header'>
                <div className='container flex my-1'>
                    <h1>Rick and Morty Memory Game</h1>
                    <div>
                        <p>Score: 0</p>
                        <p>Best score: 0</p>
                    </div>
                </div> 
            </div>
            {images.map(image => (
                <MemoryCard key={image.id} image={image}/>
            ))}
        </div>
    )
}

export default Game
